import React from "react";
import classes from './UsersList.module.css'
import Card from "../UI/Card";

const UserList =(props) =>{
    return(
        <Card className={classes.users}>
      <ul>
        {props.map(user =>{
            <li>
                {/* {user.name} ({user.age} years of old) */}
                {user.name}
            </li>
        })}
      </ul>
      </Card>
    );
}

export default UserList;
